import React, { Component } from "react";
import { Link } from "react-router-dom";

class TextBox extends Component {
  render() {
    return (
<div class="colorlib-intro">
			<div class="container">
				<div class="row">
					<div class="col-sm-12 text-center">
						<h2 class="intro introbord">It started with a simple idea: To create the best place for shopping
							shoes from the
							best supplier around the world.</h2>
					</div>
				</div>
			</div>
		</div>
    );
  }
}

export default TextBox;
